import React from "react";
import { Link, useNavigate } from "react-router-dom";
import CardSort from "./assets/Icons/CardSort.png"

function Home({ selectedItems }) {
  const navigate = useNavigate();

  const forms = [
    { name: "Intake Form", imgSrc: CardSort },
    { name: "Color", imgSrc: "color_form.png" },
    { name: "Word", imgSrc: "word_form.png" },
    { name: "Color/Word", imgSrc: "color_word_form.png" },
  ];

  return (
    <div className="app-container">
      <div className="available-forms">
        <h2>Select Forms</h2>
        <div className="forms-grid">
          {forms.map((form, index) => (
            <div className="form-item" key={index} onClick={() => navigate(`/settings/${form.name}`)}>
              <img src={form.imgSrc} alt={form.name} />
              <p>{form.name}</p>
            </div>
          ))}
        </div>
      </div>

      <div className="selected-list">
        <h2>Selected Forms</h2>
        <div className="selected-items">
          {selectedItems.map((item, index) => (
            <div className="selected-item" key={index}>
              <img src={item.imgSrc} alt={item.name} />
              <span>{item.name}</span>
              {/* Edit button to go back to the settings page */}
              <button onClick={() => navigate(`/settings/${item.name}`)}>Edit</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Home;
